import React, { Component } from "react";
import Searchbox from "./search_box";
//import Navbar from 'navbar-react'
//import { Container} from 'react-containers';
import { Form, FormControl, Container, Button, Navbar, Nav, NavItem, NavDropdown, MenuItem } from 'react-bootstrap';



class Header extends Component {

  handleAppsIcon = (e) => {
    document.body.scrollTop = document.documentElement.scrollTop = 0;
    //$("#menudiv").toggle();
  }


  render() {
    var tagOne = "zula";
    var tagTwo = "Sites";

    return (
        <Navbar bg="light" expand="lg">
  <Container fluid>
    <Navbar.Brand href="#">Navbar scroll</Navbar.Brand>
    <Navbar.Toggle aria-controls="navbarScroll" />
    <Navbar.Collapse id="navbarScroll">
      <Nav
        className="me-auto my-2 my-lg-0"
        style={{ maxHeight: '100px' }}
        navbarScroll
      >
        <Nav.Link href="#action1">Home</Nav.Link>
        <Nav.Link href="#action2">Link</Nav.Link>
        <NavDropdown title="Link" id="navbarScrollingDropdown">
          <NavDropdown.Item href="#action3">Action</NavDropdown.Item>
          <NavDropdown.Item href="#action4">Another action</NavDropdown.Item>
          <NavDropdown.Divider />
          <NavDropdown.Item href="#action5">
            Something else here
          </NavDropdown.Item>
        </NavDropdown>
        <Nav.Link href="#" disabled>
          Link
        </Nav.Link>
      </Nav>
      <Form className="d-flex">
        <FormControl
          type="search"
          placeholder="Search"
          className="me-2"
          aria-label="Search"
        />
        <Button variant="outline-success">Search</Button>
      </Form>
    </Navbar.Collapse>
  </Container>
</Navbar>

    );
    return (
      <div className="globalheader">
        <a href="/">
        <div className="globalheader_logo">
          <div className="globalheader_logo_img">
            <img alt="" src={process.env.PUBLIC_URL + '/zulaimglib/cloud.8.png'} 
            style={{width:"100%"}} />
          </div> 
          <div className="globalheader_logo_txt">
          <div className="globalheader_logo_txt_one">{tagOne}</div>
          <div className="globalheader_logo_txt_two">{tagTwo}</div>
          </div>
        </div>
        </a>
        <div className="globalheader_global_links">
          <div onClick={this.handleAppsIcon} className="material-icons globalheader_icon">info</div>
          <div onClick={this.handleAppsIcon} className="material-icons globalheader_icon">settings</div>

        </div>
      </div>
    );
  }
}

export default Header;
